import React from 'react';
import './Bloc-style.css';
import Objet from './objet.js';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

const Testobjet = props => {
  return(
    <div className="bloc text-center">
      <div className="overflow">
        <Objet />
      </div>
      <div className="bloc-body text-dark">
      <Form>
        <Form.Group controlId="formBasicEmail">
        <Form.Label>Rechercher l'animal souhait√©</Form.Label>
        <Form.Control type="email" placeholder="Quel animal voulez vous ?" />
        </Form.Group>
        <br>
        </br>
        <Form.Group>
        <Button variant="danger" type="submit">
          Rechercher 
        </Button>
        </Form.Group>
        </Form>
        <h4 className="bloc-title">{props.title}</h4>
        <p className="bloc-text text-primary">
            {props.description}
        </p>
        <a href="#" className="btn btn-outline-danger">{props.textbutton}</a>
      </div>
    </div>
  );
}

export default Testobjet;
